import './movies.scss'
import React from "react";
import Header from '../Header/Header';
import SearchForm from './SearchForm/SerachForm';
import MoviesCardList from './MoviesCardList/MoviesCardList';

function Movies (){
    return (
        <div className='movies'>
<Header/>
<SearchForm/>
<MoviesCardList/>
</div>
    );
}

export default Movies;
